import React from 'react';
import Button from './Buttons';

const style = `
.header {
  height: 75vh;
  width: 100%;
  background: url(https://media.giphy.com/media/ZcdJJvDqTgdGZK8Xd3/giphy.gif) repeat center;
  background-size: cover;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

.name {
  font-size: 60px;
}

.info {
  color: white;
  margin: 0px;
}
`;

const Header = () => {
  return (
    <div className="header">
      <style>{style}</style>
      <h1 className="name info">Mark Vincent Go</h1>
      <h3 className="info">Full-Stack Software Engineer</h3>
      <div className="btn-container">

      {[1,2,3,4,5].map((button) => (
        <Button />
        ))}
      </div>
    </div>
  );
};

export default Header;
